INSERT INTO "public"."product_product_translation" ("id", "language_code", "title", "meta_title", "meta_description", "short_description", "description", "slug", "master_id", "description_editorjs") VALUES
(1, 'en', 'Toy Story', 'Toy Story', 'A cowboy doll is profoundly threatened and jealous when a new spaceman action figure supplants him as top toy in a boy''s bedroom.', NULL, NULL, 'toy-story', 1, '{"time": 1688931984.622859, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A cowboy doll is profoundly threatened and jealous when a new spaceman action figure supplants him as top toy in a boy''s bedroom."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2, 'cs', 'Toy Story', 'Toy Story', 'Panenka kovboje je hluboce ohroena a rl, kdy ji nov figurka kosmonauta vytla z pozice nejlep hraky v chlapeckm pokoji.', NULL, NULL, 'toy-story', 1, '{"time": 1688931984.622872, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Panenka kovboje je hluboce ohroena a rl, kdy ji nov figurka kosmonauta vytla z pozice nejlep hraky v chlapeckm pokoji."}, "type": "paragraph"}], "version": "2.26.5"}'),
(3, 'en', 'Jumanji', 'Jumanji', 'When two kids find and play a magical board game, they release a man trapped in it for decades - and a host of dangers that can only be stopped by fin', NULL, NULL, 'jumanji', 2, '{"time": 1688931985.123601, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "When two kids find and play a magical board game, they release a man trapped in it for decades - and a host of dangers that can only be stopped by finishing the game."}, "type": "paragraph"}], "version": "2.26.5"}'),
(4, 'cs', 'Jumanji', 'Jumanji', 'Kdy dv dti najdou a hraj kouzelnou deskovou hru, osvobod mue, kter v n byl po desetilet uvznn - a spoustu nebezpe, kter lze zastavit pou', NULL, NULL, 'jumanji', 2, '{"time": 1688931985.123622, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Kdy dv dti najdou a hraj kouzelnou deskovou hru, osvobod mue, kter v n byl po desetilet uvznn - a spoustu nebezpe, kter lze zastavit pouze dokonenm hry."}, "type": "paragraph"}], "version": "2.26.5"}'),
(5, 'en', 'Heat', 'Heat', 'A group of high-end professional thieves start to feel the heat from the LAPD when they unknowingly leave a clue at their latest heist.', NULL, NULL, 'heat', 6, '{"time": 1688931985.496267, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A group of high-end professional thieves start to feel the heat from the LAPD when they unknowingly leave a clue at their latest heist."}, "type": "paragraph"}], "version": "2.26.5"}'),
(6, 'cs', 'Heat', 'Heat', 'Skupin pikovch profesionlnch zlodj zane bt horko od losangelesk policie, kdy pi sv posledn loupei nevdomky zanechaj stopu.', NULL, NULL, 'heat', 6, '{"time": 1688931985.496291, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Skupin pikovch profesionlnch zlodj zane bt horko od losangelesk policie, kdy pi sv posledn loupei nevdomky zanechaj stopu."}, "type": "paragraph"}], "version": "2.26.5"}'),
(7, 'en', 'GoldenEye', 'GoldenEye', 'Years after a friend and fellow 00 agent is killed on a joint mission, a Russian crime syndicate steals a secret space-based weapons program known as ', NULL, NULL, 'goldeneye', 10, '{"time": 1688931986.711092, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Years after a friend and fellow 00 agent is killed on a joint mission, a Russian crime syndicate steals a secret space-based weapons program known as \"GoldenEye\" and James Bond has to stop them from using it."}, "type": "paragraph"}], "version": "2.26.5"}'),
(8, 'cs', 'GoldenEye', 'GoldenEye', 'Mnoho let pot, co je na spolen misi zabit jeho ptel a kolega agent 00, ukradne rusk zloineck syndikt tajn vesmrn zbraov program znm ja', NULL, NULL, 'goldeneye', 10, '{"time": 1688931986.711114, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Mnoho let pot, co je na spolen misi zabit jeho ptel a kolega agent 00, ukradne rusk zloineck syndikt tajn vesmrn zbraov program znm jako \"GoldenEye\" a James Bond jim mus zabrnit v jeho pouit."}, "type": "paragraph"}], "version": "2.26.5"}'),
(9, 'en', 'Casino', 'Casino', 'A tale of greed, deception, money, power, and murder occur between two best friends: a mafia enforcer and a casino executive compete against each othe', NULL, NULL, 'casino', 16, '{"time": 1688931988.064165, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A tale of greed, deception, money, power, and murder occur between two best friends: a mafia enforcer and a casino executive compete against each other over a gambling empire, and over a fast-living and fast-loving socialite."}, "type": "paragraph"}], "version": "2.26.5"}'),
(10, 'cs', 'Casino', 'Casino', 'Pbh o chamtivosti, podvodech, penzch, moci a vradch se odehrv mezi dvma nejlepmi pteli: mafinsk vymaha a editel kasina spolu soupe', NULL, NULL, 'casino', 16, '{"time": 1688931988.064185, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Pbh o chamtivosti, podvodech, penzch, moci a vradch se odehrv mezi dvma nejlepmi pteli: mafinsk vymaha a editel kasina spolu soupe o imprium hazardnch her a o rychle ijc a rychle milujc spoleenskou smetnku."}, "type": "paragraph"}], "version": "2.26.5"}'),
(11, 'en', 'Sense and Sensibility', 'Sense and Sensibility', 'Rich Mr. Dashwood dies, leaving his second wife and her three daughters poor by the rules of inheritance. The two eldest daughters are the title oppos', NULL, NULL, 'sense-and-sensibility', 17, '{"time": 1688931988.432147, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Rich Mr. Dashwood dies, leaving his second wife and her three daughters poor by the rules of inheritance. The two eldest daughters are the title opposites."}, "type": "paragraph"}], "version": "2.26.5"}'),
(12, 'cs', 'Sense and Sensibility', 'Sense and Sensibility', 'Bohat pan Dashwood umr a zanechv svou druhou enu a jej ti dcery chud podle pravidel ddictv. Dv nejstar dcery jsou titulnmi protihrkam', NULL, NULL, 'sense-and-sensibility', 17, '{"time": 1688931988.432157, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Bohat pan Dashwood umr a zanechv svou druhou enu a jej ti dcery chud podle pravidel ddictv. Dv nejstar dcery jsou titulnmi protihrkami."}, "type": "paragraph"}], "version": "2.26.5"}'),
(13, 'en', 'Ace Ventura: When Nature Calls', 'Ace Ventura: When Nature Calls', 'Ace Ventura, Pet Detective, returns from a spiritual quest to investigate the disappearance of a rare white bat, the sacred animal of a tribe in Afric', NULL, NULL, 'ace-ventura-when-nature-calls', 19, '{"time": 1688931989.381172, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ace Ventura, Pet Detective, returns from a spiritual quest to investigate the disappearance of a rare white bat, the sacred animal of a tribe in Africa."}, "type": "paragraph"}], "version": "2.26.5"}'),
(14, 'cs', 'Ace Ventura: When Nature Calls', 'Ace Ventura: When Nature Calls', 'Zvec detektiv Ace Ventura se vrac z duchovn vpravy, aby vyetil zmizen vzcnho blho netopra, posvtnho zvete jednoho africkho kmene.', NULL, NULL, 'ace-ventura-when-nature-calls', 19, '{"time": 1688931989.381185, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Zvec detektiv Ace Ventura se vrac z duchovn vpravy, aby vyetil zmizen vzcnho blho netopra, posvtnho zvete jednoho africkho kmene."}, "type": "paragraph"}], "version": "2.26.5"}'),
(15, 'en', 'City of Lost Children, The (Cit des enfants perdus, La)', 'City of Lost Children, The (Cit des enfants perdus, La)', 'A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process.', NULL, NULL, 'city-of-lost-children-the-cite-des-enfants-perdus-la', 29, '{"time": 1688931989.75472, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process."}, "type": "paragraph"}], "version": "2.26.5"}'),
(16, 'cs', 'City of Lost Children, The (Cit des enfants perdus, La)', 'City of Lost Children, The (Cit des enfants perdus, La)', 'Vdec v surrealistick spolenosti un dti, aby jim ukradl sny, a douf, e zpomal jeho strnut.', NULL, NULL, 'city-of-lost-children-the-cite-des-enfants-perdus-la', 29, '{"time": 1688931989.754736, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Vdec v surrealistick spolenosti un dti, aby jim ukradl sny, a douf, e zpomal jeho strnut."}, "type": "paragraph"}], "version": "2.26.5"}'),
(17, 'en', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'In a future world devastated by disease, a convict is sent back in time to gather information about the man-made virus that wiped out most of the huma', NULL, NULL, 'twelve-monkeys-aka-12-monkeys', 32, '{"time": 1688931990.216912, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In a future world devastated by disease, a convict is sent back in time to gather information about the man-made virus that wiped out most of the human population on the planet."}, "type": "paragraph"}], "version": "2.26.5"}'),
(18, 'cs', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'Ve svt budoucnosti, kter je znien nemocemi, je odsouzenec vysln zpt v ase, aby shromdil informace o viru, kter byl zpsoben lovkem a kter', NULL, NULL, 'twelve-monkeys-aka-12-monkeys', 32, '{"time": 1688931990.216934, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ve svt budoucnosti, kter je znien nemocemi, je odsouzenec vysln zpt v ase, aby shromdil informace o viru, kter byl zpsoben lovkem a kter vyhubil vtinu lidsk populace na planet."}, "type": "paragraph"}], "version": "2.26.5"}'),
(19, 'en', 'Babe', 'Babe', 'Babe, a pig raised by sheepdogs on a rural English farm, learns to herd sheep with a little help from Farmer Hoggett.', NULL, NULL, 'babe', 34, '{"time": 1688931991.07861, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Babe, a pig raised by sheepdogs on a rural English farm, learns to herd sheep with a little help from Farmer Hoggett."}, "type": "paragraph"}], "version": "2.26.5"}'),
(20, 'cs', 'Babe', 'Babe', 'Babe, prase vychovvan ovckmi psy na venkovsk farm v Anglii, se s malou pomoc farme Hoggetta nau pst ovce.', NULL, NULL, 'babe', 34, '{"time": 1688931991.078634, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Babe, prase vychovvan ovckmi psy na venkovsk farm v Anglii, se s malou pomoc farme Hoggetta nau pst ovce."}, "type": "paragraph"}], "version": "2.26.5"}'),
(21, 'en', 'Clueless', 'Clueless', 'Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school''s pecking scale. Seeing herself as a matchmaker, Cher first ', NULL, NULL, 'clueless', 39, '{"time": 1688931991.434553, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school''s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other."}, "type": "paragraph"}], "version": "2.26.5"}'),
(22, 'cs', 'Clueless', 'Clueless', 'Mlk, bohat a spoleensky spn Cher je na vrcholu ebku nejlepch student sv stedn koly v Beverly Hills. Cher se povauje za dohazovaku', NULL, NULL, 'clueless', 39, '{"time": 1688931991.43457, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Mlk, bohat a spoleensky spn Cher je na vrcholu ebku nejlepch student sv stedn koly v Beverly Hills. Cher se povauje za dohazovaku a nejprve pemluv dva uitele, aby spolu chodili."}, "type": "paragraph"}], "version": "2.26.5"}'),
(23, 'en', 'Seven (a.k.a. Se7en)', 'Seven (a.k.a. Se7en)', 'Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his motives.', NULL, NULL, 'seven-aka-se7en', 47, '{"time": 1688931991.813942, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his motives."}, "type": "paragraph"}], "version": "2.26.5"}'),
(24, 'cs', 'Seven (a.k.a. Se7en)', 'Seven (a.k.a. Se7en)', 'Dva detektivov, novek a vetern, ptraj po sriovm vrahovi, jeho motivem je sedm smrtelnch hch.', NULL, NULL, 'seven-aka-se7en', 47, '{"time": 1688931991.813953, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Dva detektivov, novek a vetern, ptraj po sriovm vrahovi, jeho motivem je sedm smrtelnch hch."}, "type": "paragraph"}], "version": "2.26.5"}'),
(25, 'en', 'Usual Suspects, The', 'Usual Suspects, The', 'A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which began when five criminals met at a seemingly random po', NULL, NULL, 'usual-suspects-the', 50, '{"time": 1688931992.258461, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which began when five criminals met at a seemingly random police lineup."}, "type": "paragraph"}], "version": "2.26.5"}'),
(26, 'cs', 'Usual Suspects, The', 'Usual Suspects, The', 'Jedin peiv vyprv o spletitch udlostech, kter vedly k dsiv pestelce na lodi, je zaala, kdy se pt zloinc setkalo na zdnliv nhodn', NULL, NULL, 'usual-suspects-the', 50, '{"time": 1688931992.258468, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Jedin peiv vyprv o spletitch udlostech, kter vedly k dsiv pestelce na lodi, je zaala, kdy se pt zloinc setkalo na zdnliv nhodn policejn schzce."}, "type": "paragraph"}], "version": "2.26.5"}'),
(27, 'en', 'From Dusk Till Dawn', 'From Dusk Till Dawn', 'Two criminals and their hostages unknowingly seek temporary refuge in a truck stop populated by vampires, with chaotic results.', NULL, NULL, 'from-dusk-till-dawn', 70, '{"time": 1688931992.630233, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Two criminals and their hostages unknowingly seek temporary refuge in a truck stop populated by vampires, with chaotic results."}, "type": "paragraph"}], "version": "2.26.5"}'),
(28, 'cs', 'From Dusk Till Dawn', 'From Dusk Till Dawn', 'Dva zloinci a jejich rukojm nevdomky hledaj doasn toit na odpovadle pro kamiony, kter obvaj upi, co m chaotick nsledky.', NULL, NULL, 'from-dusk-till-dawn', 70, '{"time": 1688931992.630241, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Dva zloinci a jejich rukojm nevdomky hledaj doasn toit na odpovadle pro kamiony, kter obvaj upi, co m chaotick nsledky."}, "type": "paragraph"}], "version": "2.26.5"}'),
(29, 'en', 'Happy Gilmore', 'Happy Gilmore', 'A rejected hockey player puts his skills to the golf course to save his grandmother''s house.', NULL, NULL, 'happy-gilmore', 104, '{"time": 1688931992.966741, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A rejected hockey player puts his skills to the golf course to save his grandmother''s house."}, "type": "paragraph"}], "version": "2.26.5"}'),
