(1485, 'en', 'Get Him to the Greek', 'Get Him to the Greek', 'A record company intern is hired to accompany out-of-control British rock star Aldous Snow to a concert at L.A.''s Greek Theater.', NULL, NULL, 'get-him-to-the-greek', 78209, '{"time": 1688932373.079415, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A record company intern is hired to accompany out-of-control British rock star Aldous Snow to a concert at L.A.''s Greek Theater."}, "type": "paragraph"}], "version": "2.26.5"}'),
