(1991, 'en', 'Red 2', 'Red 2', 'Retired CIA agent Frank Moses reunites his unlikely team of elite operatives for a global quest to track down a missing portable nuclear device.', NULL, NULL, 'red-2', 103810, '{"time": 1688932511.381772, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Retired CIA agent Frank Moses reunites his unlikely team of elite operatives for a global quest to track down a missing portable nuclear device."}, "type": "paragraph"}], "version": "2.26.5"}'),
