(2511, 'en', 'Bridge of Spies', 'Bridge of Spies', 'During the Cold War, an American lawyer is recruited to defend an arrested Soviet spy in court, and then help the CIA facilitate an exchange of the sp', NULL, NULL, 'bridge-of-spies', 143385, '{"time": 1688932664.493496, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "During the Cold War, an American lawyer is recruited to defend an arrested Soviet spy in court, and then help the CIA facilitate an exchange of the spy for the Soviet captured American U2 spy plane pilot, Francis Gary Powers."}, "type": "paragraph"}], "version": "2.26.5"}'),
